Jeanne Mas Qui Est Son Mari: Jeanne Mas: qui est-elle?
Portrait de Jeanne Mas Jeanne Mas, de son vrai nom Jeanne Masuel, est une chanteuse française née le 28 février 1958 à Alicante en Espagne. Elle grandit en France et se passionne très tôt pour la musique. Avec sa voix puissante et son look original, elle se démarque rapidement dans l’industrie musicale.&nbsp;
Carrière musicale et succès Jeanne Mas connaît un succès fulgurant dans les années 1980 avec des titres emblématiques tels que “Toute première fois”, “En rouge et noir”, ou encore “Johnny Johnny”.
